pe_region`, `express`, `lab_qgby`, `lab_zpbz`, `lab_qtth`, `lab_jkbs`, `lab_hwzy`, `is_luck`, `luck_num`, `luck_times`, `is_miao`, `ts_a`, `ts_b`, `ts_c`, `bonus_free_all` ) VALUES  ('119', '76', 'HHS000119', '当红辣子鸡', '+', '6', '0', '', '49', '1.000', '36.00', '30.00', '0.00', '0', '0', '1', '', '集天下之大成\r\n夺天地之造化\r\n举众生之正气\r\n灭魔邪之罪孽\r\n', '<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-size:12.0pt;font-family:宋体;\">你居然是这样的辣鸡</span><span style=\"font-size:12.0pt;\"></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">你过来</span> <span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">我有事要问你</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">你知道关于辣鸡的一百种表情包</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span><a href=\"http://reimg.alai.net/imgtxttemp/718_4cca32d21fbf1bdd8b15fe04a48f4d0c.jpg\" target=\"_blank\"><span style=\"color:#006DB7;text-decoration:none;\"><span><img src=\"file://C:\\Users\\杨\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.jpg\" alt=\"http://reimg.alai.net/imgtxttemp/718_4cca32d21fbf1bdd8b15fe04a48f4d0c.jpg\" width=\"120\" height=\"167\" border=\"0\" /></span></span></a></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">可是</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">你真的吃过</span> <span style=\"font-family:宋体;\">辣鸡</span> <span style=\"font-family:宋体;\">吗</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">当今武林</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">对于</span> <span style=\"font-family:宋体;\">真·辣（子）鸡</span> <span style=\"font-family:宋体;\">的正统之争</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">从来没有停过</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">重庆</span> <span style=\"font-family:宋体;\">贵州</span> <span style=\"font-family:宋体;\">四川</span> <span style=\"font-family:宋体;\">云南</span> <span style=\"font-family:宋体;\">山东</span> <span style=\"font-family:宋体;\">新疆</span> <span style=\"font-family:宋体;\">湖南</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">……到底哪里的最好吃呢？</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">我们采访了多位美食家</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">试图揭开这个困扰了中国</span><span>40%</span><span style=\"font-family:宋体;\">吃货的千古谜题</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">首先</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">我们请到了来自重庆的著名厨师</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">麻辛束先生</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">为我们做了一盘</span><span style=\"font-family:华文中宋;\">「正宗·歌乐山·绝·辣子鸡」</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">电光火石，花椒飞溅间</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">鸡炸了</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span><img src=\"file://C:\\Users\\杨\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image003.png\" width=\"484\" height=\"357\" border=\"0\" /></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“这道菜的真正奥义，就在于——酥”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">麻辛束先生收起锅铲，对我们说</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“炸鸡的油温必须足够高，锅勺快速翻动，才能使鸡块外酥里嫩，当然，不能忘了给它注入灵魂”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“那么，您认为川菜的灵魂是什么呢？”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">麻师傅撒了一把辣椒：</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">“妈批，是重庆”</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span> </span> \r\n</p>\r\n<table align=\"left\" cellpadding=\"0\" cellspacing=\"0\">\r\n	<tbody>\r\n		<tr>\r\n			<td width=\"6\" height=\"14\">\r\n				<br />\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<br />\r\n			</td>\r\n			<td style=\"border:.75pt solid black;vertical-align:top;background:white;\" width=\"543\" height=\"82\" bgcolor=\"white\">\r\n				<span> \r\n				<table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\">\r\n					<tbody>\r\n						<tr>\r\n							<td>\r\n								<div style=\"padding:4.35pt 7.95pt 4.35pt 7.95pt;\" class=\"shape\">\r\n									<p class=\"MsoNormal\">\r\n										<span style=\"font-family:宋体;\">我们对重庆辣子鸡的评价是：</span><span></span> \r\n									</p>\r\n									<p class=\"MsoNormal\">\r\n										<span style=\"font-family:宋体;\">酥香脆爽，呈现了干爽的麻辣口感，干辣椒、花椒、葱姜的使用绝对重庆，除了火锅，它应该是重庆味道最好的代表之一了。</span><span></span> \r\n									</p>\r\n								</div>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n</span>&nbsp;\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<span>&nbsp;</span> \r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<br />\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">接着</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">来自贵州的少数民族厨师</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">慈坝蜡女士</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">为我们带来了当地特色</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span><img src=\"file://C:\\Users\\杨\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image005.png\" width=\"429\" height=\"332\" border=\"0\" /></span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">由于语言不通，我们跳过了对厨师的采访</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">请来了一位祖籍贵州的小学生王小明</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span><img src=\"file://C:\\Users\\杨\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image007.jpg\" width=\"296\" height=\"366\" border=\"0\" /></span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-family:宋体;\">进行品尝</span><span></span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-align:center;\" align=\"center\">\r\n	<span style=\"font-